import './App.css';
import logo from './Assets/logo0217.svg';
import tito from './Assets/tito.png';
import React from 'react';
// import { Unity, useUnityContext } from 'react-unity-webgl';
import Unity, { UnityContent } from "react-unity-webgl";

function App() {

  // const { unityProvider } = useUnityContext({
  //   loaderUrl: "./build/SampleAnimELLE.loader.js",
  //   dataUrl: "./build/SampleAnimELLE.data",
  //   frameworkUrl: "./build/SampleAnimELLE.framework.js",
  //   codeUrl: "./build/SampleAnimELLE.wasm",
  // });

  const unityContent = new UnityContent(

    "build/SampleAnimELLE.js"
  );


  return (

    <div className='main'>

      <div className='gameContainer'>
        {/* <h2>AnimELLE Crossing coming soon!</h2> */}
        {/* <Unity unityProvider={unityProvider} /> */}
        <Unity unityContent={this.unityContent} />
      </div>

      <div className='divContainer'>

        <div className='instruct-filler'>
          <h4>Listen to Tito!</h4>
          <img src={tito} className='tito' alt="tito" />
        </div>

        <div className='logoContainer'>

          <div className='imgContainer'>
            <img src={logo} className='logo' alt="game logo" />
            <h3 className='credits'>Credits:</h3>
          </div>




          <div class="row">

            <div class="column">
              <p className='names'>Tam Nguyen </p>
              <p className='names'>Justin Reeves</p>
              <p className='names'>Natali Siam-Pollo</p>
            </div>

            <div class="column">
              <p className='names'>Derek Dyer</p>
              <p className='names'>Trevor Larson</p>
            </div>

          </div>  {/*<!--row--> */}

        </div> {/*<!--logo--> */}

        <div className='instruct-actual'>
          <h4>Instructions</h4>
        </div>


      </div> {/*<!--divContainer--> */}


    </div>



  );
}

export default App;
